import os, base64

def CriarPastaCasoNãoExista(Caminho):
    try:
        if not os.path.isdir(Caminho): # Verificar se está pasta não foi criada.
            os.mkdir(Caminho)          # Criar a pasta
            print('Caminho: \'' + str(Caminho) + '\' criado!')
    except:
        print('Erro na função: \'CriarPastaCasoNãoExista(Caminho)\'.')

def CriarArquivo(Caminho, Nome, Código):
    try:
        Caminho = Caminho.replace('\\', '/')
        decodeit =  open(f'.{Caminho}{Nome}', 'wb')
        decodeit.write(base64.b64decode(Código))
        decodeit.close()
        print('O arquivo foi atualizado. (\'.' + str(str(Caminho) + str(Nome)) + '\')')
    except Exception as e:
        print(e)

def gerartudo():
    CriarPastaCasoNãoExista('./pptx/')
    CriarPastaCasoNãoExista('.//pptx//template/')
    CriarArquivo('/pptx//template//', 'default.pptx', '')